for a, b in vs:
    for i in range(3):
        for j in range(3):
            x, y = a+i-2, b+j-2
            if x < 0 or W-3 < x or y < 0 or H-3 < y:
                continue
            if (x, y) in vvs:
#                print(x, y, a, b)
                continue
            c = 0
#            print(x, y, a, b)
            for k in range(3):
                for l in range(3):
#                    print(x+k, y+l)
                    if (x+k, y+l) in vs:
                        c += 1
#            print(c, x, y)
            R[c] += 1
            vvs.add((x, y))

R[0] = (H-2)*(W-2)-sum(R)
